import './css/education.css';
import EducationComp from './addComp/educationAdd';

class Education extends Component {
    constructor() {
        super();
    }

    render() {
        return (
            <div id="education">
                <div id="headingwrap">
                    <div id="heading">EDUCATION</div>
                    <button id="addExp">+</button>
                </div>

                <EducationComp title="Uni of London"
                desc="Bachelor's in Software Engineering"
                since="2017"
                to="2020"
                where="London,UK"></EducationComp>
            </div>
        )
    }


}



export default Education
